import React, { Component } from "react";

class UserItem extends Component {
  constructor() {
    super();
    console.log(123);
  }

  render() {
    const userItemStyles = {
      margin: "60px 10px",
    };

    return (
      <div style={userItemStyles}>
        <div>User Items</div>
      </div>
    );
  }
}

export default UserItem;
